import java.util.*;

public class InifiniteLoop {
    public static int ladderLength(String start, String end,
                                   HashSet<String> dict) {

        LinkedList<String> list = new LinkedList<String>();

        if (start != null) {
            while(true) {
                list.add("");
            }
        } else {
            return 0;
        }
    }
}
